import "./App.css";
import GlassmorphismBox from "./components/glass";
import Navbar from "./components/navbar";
import yinyang from "./media/yinyang.png";
function App() {
	return (
		<div className="App">
			<Navbar />
			<body className="App-body">
				<div class="container">
					<div class="side">
						<img src={yinyang} className="App-logo" alt="logo" />
					</div>
				</div>
				<GlassmorphismBox />
			</body>
		</div>
	);
}

export default App;
